import React from "react";
import { Link } from "react-router-dom";
import Navbar from "../components/Navbar";

function Home() {
  return (
    <div>
      <Navbar />
      <h1 className="h1 ">Home</h1>
      <Link to="/StaffGig">
        <button class="btn btn-primary">Staff Gig</button>
      </Link>
      <Link to="/PostGig">
        <button class="btn btn-primary">Post Gig</button>
      </Link>
    </div>
  );
}

<>
  <div className="d-flex-column">
    <div className="h1 m-10 d-flex justify-center">Welcome to Hop</div>
    <div></div>
    <button className="d-block mt-10 btn btn-dark m-auto" onClick={login}>
      Continue with Google
    </button>
  </div>
</>;

export default Home;
